INSERT INTO `course` VALUES ('11', '42', '1474171883314.jpg', 'Table Tennis Course', '1', 'SPORTS', '43', 'Table tennis', '18', 'Best sell course', 'Jimmy Butler is extremely normal.\r\n\r\nThe normal part is he likes to play table tennis — or ping pong, as it’s recreationally known. And he has tight muscles.\r\n\r\nThe extreme part is that he is the best table tennis player in the country and at one time was one of the best in the world, and the tight muscles — well, that’s a situation that goes well beyond any reasonable level of comprehension.\r\n\r\n“To say my muscles were tight,” Butler laughed, “that’s such an understatement. That sounds so harmless.”\r\n\r\nIt wasn’t harmless. It wasn’t anything even remotely close to harmless. At its worst, every muscle in Butler’s body was so tight, so constricted with relentless pressure, that his spine and organs were being literally crushed.\r\n\r\n“It felt like a snake was wrapped around me,” Butler said.\r\n\r\nForget table tennis, the man couldn’t digest food. Couldn’t go to the bathroom. After competing in both the 1992 and 1996 Olympic Games, and nearly making the round of 16 in Barcelona in ‘92, his career was abruptly halted in 1998. Not too long after, he was entirely bedridden, unable to even sit up for any extended period of time.“My muscles were as hard as concrete,” he said. “And there was no human being that could fix me.”', '60', '75.00', '15+', '10+', '0', '0', '0.00', '0.00', 'CA', 'Santa Ana', '1001 E santa clara Ave', '', '92706', '33.7667519', '-117.856804', '1', '30.00', '2', '3.00', '0.00', '5.00', '5.00', '10.00', '10.00', '1474171890058.jpg#1474171897530.jpg#1474171903630.jpg', '', '1', '150', '0', '4', '5.00', '2016-10-25 08:36:16', '11@1#11@2#11@7#13@1#13@2#13@7#15@3#15@4#15@5#15@6#17@2', null, null, '1');
INSERT INTO `course` VALUES ('12', '64', '1473741892859.jpg', 'Sungha\'s classroom， practice make perfect!', '2', 'ARTS', '4', 'Guitar', '18', 'Best sell course', 'Music is my life. As cheesy as that phrase goes， for me， it holds true. I\'m Alice. Everything I do and have been doing has been geared towards music. I\'ve been in one working/gigging band or other without break for the past 10 years. I began intensely learning to play guitar at the age of 9 and have not stopped. The second I started learning I knew that that was what I wanted to do. Fast forward to now， and here I am loving every minute of it. I took lessons of my own as a kid， which helped shape me greatly. I then picked up bass at the age of 13. \nI\'ve taught personalized lessons for over 6 years now without a single complaint. At this point in my musical career， the majority of my experience and attitude has come from being \"in the field\". I\'ve played South By South West， Austin City Limits， Westheimer Block Party， opened up for bands like the Misfits and Rage Against the Machine， shared the stage with bands like The Wallflowers， Minus the Bear， and Echo and the Bunnymen， and been on tour and lived the whole life more often than not! \nYOU can be an active musician. If you have the passion and desire. The first step though， is learning your instrument. Learning an instrument is something that stays with you for the rest of your life. It\'s an unfaltering companion that can benefit you in so many ways. I like to toss out the strict \"teacher/student\" regiment and create a laid back， fun， easy going atmosphere. I want to be buds and SHARE music with each other and introduce you into this world that I have grown to love so so much. There is nothing more rewarding. I promise. So let\'s get started!\n\n*** Lesson Details ***\nI am very laid back. Your progress is directly linked to you. I will give it my all to teach you and help you， but if you don\'t practice or soak it in， that\'s on you! I hate having a tense， seminar type lesson atmosphere. Lessons with me will be easy going and relaxed. I don\'t want to have to put on a sweater vest and wag my finger as a I scold you. That\'s just not me. \nHowever， I DO expect you to get things done. Why waste your time with lessons if you\'re not going to take them seriously on any level? The curriculum will be totally personalized for YOU. After all， not everybody likes the same music and style. The first lesson or two will be getting a handle on exactly what YOU want to learn and what YOU want out of it. Finding out your favorite bands/artists， guitar players， bass players， etc. There\'s nothing worse than being taught something you have no desire for， but having it drilled into your head week after week! So whether that be blues， folk， metal， whatever， that\'s the first step. With that information I\'ll begin constructing and laying out the rest of your lesson plan.\n\n*** Studio Equipment ***\nAlthough I assume you have an instrument of your own (if not I recommend getting one， it sort of helps)， if you\'re looking to just try things out at first I have more than a few extra that I\'d be happy to let you use. My teaching studio doubles as a recording studio as well. This means 2 things: if ever you would like to record some of your music you know where to go! And also， I have the means to record the entire lesson if you\'d like. You\'ll need to supply the blank CD(s) of course. It\'s not a requirement to record the lesson， just an option! Basically， I have everything you could ever possibly need for music lessons here. So you\'re set.\n\n*** Travel Equipment ***\nGuitars， amps， etc. anything that would be needed I\'ve got!\n\n*** Specialties ***\nI am versed in blues， rock， metal， folk， hardcore， acoustic-finger-style and various other acoustic styles， and more. Through teaching and experience as a working musician I have mastered most genres and styles. When sitting at home jamming in my free time， I probably most frequently find myself playing acoustic finger-style， blues， folk， or hardcore， but love and appreciate most styles. So， bring it on!', '60', '50.00', '15+', '5+', '1', '10', '16093.44', '15.00', 'CA', 'Rowland Heights', '2600 Hayride CT', '', '91748', '33.974252', '-117.913337', '2', '25.00', '2', '3.00', '3.00', '5.00', '5.00', '10.00', '10.00', '1473741663830.jpg#1473741672350.jpg#1473741704565.jpg', 'https://www.youtube.com/watch?v=lW8UZ0r1mZo', '1', '951', '1', '5', '4.00', '2016-10-25 08:28:47', '13@1#13@2#13@3#13@4#13@5#13@6#13@7#15@1#15@2#15@3#15@4#15@5#15@6#15@7', null, null, '1');
