INSERT INTO `course` VALUES ('32', '42', '1476933381374.png', 'dance course', '2', 'ARTS', '66', 'Dance', '0', '', '1) Won over 10 championships in my juniors career. \n2) Was ranked top 100 in the nation NAIA in college. \n3) Finished 3rd at nationals twice， both in 16s and 18s divisions. \n4) Was ranked in the top 15 men\'s division in the state of Texas within 2 months of playing tournaments. \n\nSession Plan:\nStep 1) Evaluate the level of the player \nStep 2) Determine the comfort level with different strokes (forehand， backhand， volley， serve， slice etc...)', '60', '20.00', '15+', '5+', '1', '10', '16093.44', '15.00', 'CA', 'Santa Ana', '713 N main st', '', '92701', '33.7511099', '-117.8673509', '0', '10.00', '2', '3.00', '0.00', '5.00', '0.00', '10.00', '0.00', '1476933418084.jpg#1476933420379.jpg', '', '0', '0', '2', '0', '0.00', '2016-10-20 12:05:08', '11@1#11@2#11@3#11@5#11@7#13@6#13@7#17@1#17@2#17@3#17@5#19@4#21@1#21@3#23@2', 'achievement', 'forehand  ,   backhand and every hand is soooooooooooooooooooooooooooooo good', '1');
INSERT INTO `course` VALUES ('33', '100', '1477372462087.jpg', 'Jim\'s table tennis', '1', 'SPORTS', '43', 'Table tennis', '0', '', 'Offensive player with a very strong backhand and service game.\n\n 4-time U.S. Men\'s Singles National Champion 1990， 1992， 1993， 2014. Two-time U.S. Olympic Team Member 1992， 1996. 1995 World Team Cup Bronze  Medalist & MVP. Highest US rating 2763. Highest world Ranking #70.\n\nStory\n Before he was 11…13…15…17 and out of the Junior’s, Jimmy Butler had won a remarkable 24 U.S. Open and Closed Championships. Already he stood  tall in the History of U.S. Table Tennis, and, as was apparent to everyone, his stature in our Sport could only continue to grow and grow and grow.\n\n            From the beginning, Jimmy’s father, Dick, had coached him, along with a sometime assist from visiting Chinese coaches Li Henan and her  husband Ai Liguo. Seven-year-old Jimmy, his proud papa says, “has been playing now a little over a year. He serves, pushes, blocks, and hits off  both wings.”\n\n            But it was Jimmy’s brother Scott, three years older, who first began winning U.S. Championships and training abroad. Mother Sue began a  Swedish-American Exchange Program with Nisse Sandberg, founder and benefactor of the celebrated Angby Club just outside Stockholm, involving host  families on both continents. Scott celebrated his 11th birthday with the Torsell family in Sweden, and was quite astonished that after he’d blown  out the candles on his birthday cake they came back lit again! Could anyone doubt there was something magical about going to Angby, to Europe?\n        \n 	\n       \n 	\n              ', '60', '69.00', 'No preference', '15+', '1', '30', '48280.32', '15.00', 'CA', 'Santa Ana', '714 N Main St', '', '92701', '33.750696', '-117.8676156', '1', '30.00', '2', '3.00', '5.00', '5.00', '10.00', '10.00', '12.00', '1477372469096.jpg#1477372472769.jpg#1477372475607.jpg', 'https://www.youtube.com/watch?v=zK26wPD9Z40', '0', '52', '1', '0', '0.00', '2016-10-25 15:07:44', '13@1#13@2#13@3#13@4#13@5#13@6#13@7#15@1#15@2#15@3#15@4#15@5#15@6#15@7#17@1#17@2#17@3#17@4#19@1#19@2#19@3#19@4', '2015 North American World Cup Singles Champion\n2015 US National Team\n2015 Pan American Team\n2014 US Men\'s Singles and Senior Champion\n2014 US National Team\n2014 US World Team\n2011 USATT Hall of Fame Inductee', 'Backhand strike， Serve， Defend', '1');
