INSERT INTO `course` VALUES ('35', '101', '1477378136891.jpg', 'Colin\'s golf club', '1', 'SPORTS', '44', 'Golf', '0', '', 'During the summer of 2015, I coached three high school golfers. Each golfer came to me with their own swings and thought processes. After working with each individual for no more then 3 weeks a piece, at the end of the summer, all three players had made their high school golf team. The amount of joy that filled my heart when I heard the news was amazing. From seeing my players struggle at the beginning and to work so hard to become better, I couldn\'t have asked for a better situation.\r\n\r\n\r\n\r\n           ', '60', '50.00', '15+', '5+', '0', '0', '0.00', '0.00', 'CA', 'Los Angeles', '10460 Pico Blvd', '', '90064', '34.0453783', '-118.4185855', '2', '20.00', '2', '3.00', '1.00', '5.00', '5.00', '10.00', '10.00', '1477378153169.jpg#1477378157356.jpg', '', '0', '7', '1', '0', '0.00', '2016-10-25 14:54:42', '13@1#15@1', 'Four year scholarship player to Point Park University men\'s golf team. \nFirst team all conference four straight years. \nFour conference championships as a team. \nThree straight national tournament appearances as a team. \nI was the one man and captain of my team my junior and senior years of college.', 'Stance, Short Game, Putting, Mechanics, Iron Play, Grip, Driving, Bunker Play, Ball Flight', '1');
INSERT INTO `course` VALUES ('36', '102', '1477419857870.jpg', 'Muhaha\'s training session', '1', 'SPORTS', '45', 'Tennis', '0', '', 'I have previously worked as a coach during several summer tennis camps in Oslo, Norway, where I coached aspiring tennis talents. Additionally, I have given private lessons to players on various levels from kids to adults for several years. I now teach friends and students at university tennis courts; mostly at Northeastern.', '60', '65.00', '10+', '3+', '1', '30', '48280.32', '20.00', 'CA', 'Santa Ana', '713 N main st', '', '92701', '33.7511099', '-117.8673509', '0', '0.00', '2', '3.00', '3.00', '5.00', '5.00', '10.00', '8.00', '1477419862061.jpg#1477419864320.jpg', '', '0', '4', '1', '0', '0.00', '2016-10-26 03:06:22', '15@1#15@2#15@3#17@2#19@2#19@3', 'I grew up playing tennis across the world competing against some of the top juniors. I was captain on the national Junior Tennis Team in Norway, and was ranked as the number 1 player in the country under 14, 16, 18. Additionally, I was ranked as the number 1 tennis player in Europe under 14 and won a bronze medal in the European Tennis Championship under 16. After high school I attended the University of North Carolina, where I played for the varsity men\'s tennis team my freshman year. During that time the team had one of it\'s best seasons ever, and we reached as high as #5 in the country.', 'Backhand, Footwork, Forehand, Point Strategy, Serve, Topspin, Volley', '1');
