INSERT INTO `course` VALUES ('38', '103', '1477426722684.jpg', 'Experienced yoga teacher', '1', 'SPORTS', '49', 'Yoga', '0', '', 'I am a  Yoga Alliance registered yoga teacher ( received all my training through YogaWorks). I have been teaching yoga for about a year and I\'ve been practicing yoga for over 12 years with top yoga instructors from YogaWorks (Vinnie Marino, Mia Togo, Vytas Baskauskas, Thomas Taubman). I teach all levels of yoga with a specialty in Vinyasa Flow. I actively teach for the following companies-- Yoga Cycle in Redondo Beach, Live Yoga Wellness in Westchester, LA Fitness in West LA and for RenewU (the app). I work with all ages.', '60', '40.00', '15+', '5+', '0', '5', '8046.72', '5.00', 'CA', 'Marina Del Rey', '4080 Glencoe Ave', '', '90292', '33.9904992', '-118.4423752', '3', '15.00', '2', '3.00', '3.00', '5.00', '6.00', '10.00', '10.00', '1477426572126.jpg#1477426574683.jpg', '', '0', '3', '1', '0', '0.00', '2016-10-26 04:22:29', '15@2', 'I was a gymnast, coach and certified gymnastics judge during my teenage years but only competed at the entry level. Since then I\'ve always been athletic, mostly playing recreational sports such as volleyball, softball, racquetball etc. I represented Hallmark Cards twice in Kansas City\'s \"Corporate Challenge\" for racquetball (we competed internally and only one woman was chosen each year). I became a runner in my 30\'s and never looked back once discovering yoga in 2003.', 'Focus, Flexibility, Core Strength, Breathing Techniques, Balance', '1');
INSERT INTO `course` VALUES ('39', '104', '1477431045006.png', 'Theatrical Dance', '2', 'ARTS', '66', 'Dance', '0', '', 'Bachelor\'s Degree in Theater from Towson University. Upright Citizens Brigade NYC graduate. 20 years dance training, 5 years professional teaching experience. Danced with various choreographers from So You Think You Can Dance such as Mia Michaels, Courtney Galiano, Shane Sparks, Brian Friedman, and Laurieann Gibson just to name a few! Has been a featured dancer/choreographer in a number of live stage projects, music videos and films. \n\nLessons will be full of laughter, high energy and motivation. Being positive is extremely important and the word \"can\'t\" is not allowed! It does not matter if you have never taken a dance class before, or are working to be a professional. I treat each student\'s individual goals with respect, and encouragement. I take the diverse and extensive training/experience I have, and apply it to my student\'s needs:)\n\nI am able to bring out the best in my students with laughter, motivation and positive re-enforcement. My students accomplish the goals they set! You miss 100% of the chances you don\'t take.', '60', '65.00', '7+', '8+', '1', '5', '8046.72', '15.00', 'CA', 'Los Angeles', '4731 Fruitland Ave, Vernon', '', '90058', '33.9954342', '-118.1925401', '10', '10.00', '2', '3.00', '0.00', '5.00', '0.00', '10.00', '0.00', '1477431050450.png#1477431055273.png#1477431062905.png', '', '0', '0', '1', '0', '0.00', '2016-10-26 10:26:44', '31@7', 'Pinegrove University of Performance Arts\nMember - National Dance Teachers Association of America\nMember - Dance Instructors of America', 'Jazz / Hip hop', '1');
INSERT INTO `course` VALUES ('40', '105', '1477441598518.png', 'Luca C', '1', 'SPORTS', '49', 'Yoga', '0', '', 'My name is Luca and I have been dancing since I was seven years old! I was one of two graduates to earn my Bachelor of Fine Art in Dance/Dance Pedagogy from Columbia College Chicago in 2011. I have since moved back to New York City where I dance for a professional modern dance company in downtown Manhattan. When I am not teaching class, I am busy being a student of my own all over New York City at prestigious studios such as Steps on Broadway, Gibney Dance Center and Broadway Dance Center. It is here where I take daily classes with the country\'s greatest dance teachers/choreographers to continue my never ending training in dance techniques and developments. \n\nAs a working professional dancer, I understand the rigor that it takes to achieve your goals and I work with my students one on one to achieve them! I have had the honor of training with the greatest dancers in the business to help me achieve my goals such as David Dorfman, Joe Goode, Alexandra Beller, Kendra Portier, and Oliver Steele.\n\nDancing and teaching dance are my greatest passions in life and I want to share them with students of all ages from 18 months to 100 years old! \n\nThank you for visiting my profile and I hope to teach you soon! \n\n\n*** Lesson Details ***\nWhether you are stepping into a dance studio for the first time or preparing for a stressful audition I will help you achieve those goals and with a smile the entire time! \n\nI believe it is important to build a relationship between teacher and student or parent, teacher and student to develop a curriculum that best benefits you or your child. Each lesson is specially designed to achieve your personal goals in whatever style of dance you decide! \n\nCome dance with me and we can fulfill those life long dreams of learning to dance and work towards a healthy and happy life!', '60', '85.00', '10+', '8+', '1', '10', '16093.44', '20.00', 'CA', 'Los Angeles', '4731 Fruitland Ave, Vernon', '', '90058', '33.9954342', '-118.1925401', '0', '0.00', '2', '3.00', '0.00', '5.00', '0.00', '10.00', '0.00', '1477441563392.png#1477441574645.png#1477441588796.png', '', '0', '0', '1', '0', '0.00', '2016-10-26 10:26:44', '23@6#25@6#27@6', 'Bachelor of Fine Arts in Dance （Columbia College Chicago）', 'Modern, Jazz, Ballet', '1');
INSERT INTO `course` VALUES ('41', '104', '1477445309330.png', 'Cindy C', '2', 'ARTS', '47', 'Piano', '0', '', 'Hello and welcome!\n\nMy name is Cindy and I\'m a piano instructor here in NYC. I created a program for beginner level students (any age). I try to make lessons fun and work with your goals!\n\nThe program covers basic music theory like note names, beats, how to sight read and how to read dynamics. I usually start off our lessons by going over a couple scales and end the lesson with a song that we would be working on at the moment. I also provide you with a sheet of notes for the day so that you can refer back to the what we\'ve went over anytime.\n\nI have taught both children and adults. I make it a priority to focus on your goals whether that\'s to learn to play classical piano, improvise when given a set of chords to a song, learn more about music theory, etc. My goal is for you to reach your goals and become a better musician. \n\nIf you have any questions, please don\'t hesitate to message me! \n\nI hope to work with you soon! \n\nAll the best,\nCindy', '60', '90.00', '4+', '5+', '1', '15', '24140.16', '15.00', 'CA', 'Los Angeles', '4731 Fruitland Ave, Vernon', '', '90058', '33.9954342', '-118.1925401', '0', '0.00', '2', '3.00', '0.00', '5.00', '0.00', '10.00', '0.00', '1477445286695.png#1477445302249.png', '', '0', '0', '1', '0', '0.00', '2016-10-26 10:26:44', '7@4#9@4#17@2#19@2', 'Musical Theater Conservatory(New York Film Acadmey)\nPiano Lessons, Music Theory and Choir', 'Classical Piano', '1');
INSERT INTO `course` VALUES ('42', '107', '1477448378807.png', 'June\'s cooking', '2', 'ARTS', '48', 'Bakery', '0', '', 'I\'m so glad you\'re here! \n\nI\'ve been in love with cooking healthy energizing food for as long as I can remember. I was born and raised in Philadelphia, and grew up surrounded by art and music; nurtured by my family, and propelled by my innate need to create. \n\nWhatever my future, the results are sure to be passionate, soulful and sincere. My mission as a certified Holistic Wellness Coach and Personal Chef is turning your kitchen from a place of anxiety and frustration, into a healing, loving environment. \n\nI work with couples and families who want to feed their family healthier meals. I specialize in various diets, from vegan + vegetarian to gluten free, paleo and ADHD. An alternative diet doesn\'t equal a bland diet. Think of me as your food advisor. We\'ll work together to create your ideal kitchen environment, setting you up for continued success, growth and vibrant living!', '60', '45.00', '10+', '5+', '1', '10', '16093.44', '20.00', 'CA', 'Los Angeles', '4731 Fruitland Ave, Vernon', '', '90058', '33.9954342', '-118.1925401', '5', '15.00', '2', '3.00', '0.00', '5.00', '0.00', '10.00', '0.00', '1477448384443.png#1477448389198.png#1477448393730.png#1477448398328.png', '', '0', '0', '1', '0', '0.00', '2016-10-26 10:26:44', '15@5#17@5#19@1#19@5#21@1#23@1', 'Personal Chef\nDuties include creating weekly menus customized to my clients needs, getting all the necessary ingredients (at the farmers market, grocery store or ordering it online), preparing and cooking all the food and packaging up everything and putting it there refrigerator.', 'I specialize in alternative diets. Everything from vegan + vegetarian to gluten free, paleo and adhd. I\'m a certified holistic health coach and personal chef.', '1');
