INSERT INTO `experience` VALUES ('10', '1', '肌肉型小腿怎样才能变细长？为此烦恼的亲看过来 ，很有效哦！', '<p>肌肉型小腿怎样才能变细长？为肌肉型小腿而烦恼的亲看过来 ，很有效哦！<br/>瘦腿要点：<br/><br/>你双腿的肌肉非常结实，想双腿变得细长，首先要令双腿肌肉松弛，将腿筋拉长，双腿自然会修长。<br/><br/>首先先介绍下预防肌肉型小腿的方法：<br/><br/><br/>一、调整站姿与走姿</p><p><img src=\"http://upload-images.jianshu.io/upload_images/1729331-26f8ab52b8bd22e0?imageMogr2/auto-orient/strip%7CimageView2/2/w/1240\" style=\"height: 793px;width: 1099px;\"/><br/><br/><br/>这是最基本却也是最重要的一点，正确的站姿不止可以矫正不好看的腿型，也可以让整个人的体态变得好看，也会让臀部和大腿的肌肉结实，甚至连驼背也能够慢慢改善，而且非常简单，只要记得站立时双膝要并拢并且打直，腰杆挺直瘦小腹，抬头挺胸，但是要持之以恒的做，然后变成一种习惯，才能够渐渐地看到效果。<br/><br/><br/>而走姿也很重要，不正确的走姿用力的部位与方式不对，容易使得小腿有腿腹进而变成萝卜腿，正确的走姿应是脚尖先着地，且走路的路径是一直线，行走时两膝盖会微微碰触摩擦。<br/><br/>二、舒展小腿腹运动<br/><br/>一整天的时间下来，脚部因地心引力向下所承受的整个身体的重量最多，再加上走路或者站立，小腿腿腹很容易因此而变得强壮，慢慢又变成肌肉，即使是坐着，腿部依然是人体最 下端部位，所以也需要舒展腿腹<br/><br/><br/>同<br/><br/>样也是很简单的动作，可坐在椅子上双腿自然下垂，也可以坐在床上将腿放平，先放松15秒时间，然后如图的方式将脚尽量往上翘，此时会感觉到小腿腹酸酸的，<br/><br/>然后翘到最顶端后停留10秒，最后在放松15秒，再做第二次，如此每脚做八次再换脚八次，一共做六组，觉得腿腹很硬或有点肿时都可以做，一天次数不限。<br/><br/>很方便简单的动作，可以在办公室或学校做，或者回家要按摩之前做都很好，可当成按摩前的热身，让腿腹先舒展热身一下，按摩的时候也比较不那么吃力。<br/><br/><br/>三、小腿腹的按摩<br/><br/>最<br/><br/>主要的功用是避免小腿腹发展成为肌肉，所以按摩的时候要很用力，不是那种舒展的按摩，是要按到会酸会痛的那种，针对腿腹部分用力的压捏按摩，让肌肉变软，<br/><br/>然后由脚踝往上经过小腿腹到膝盖，由下往上按摩，按摩的时候小腿尽量放松，大概如上图的坐姿，膝盖曲起，让小腿腹自然下垂，再按上面的方法按摩。<br/><br/>肌肉型大腿和小腿都比较难减，确切的说只能改善肌肉的形状，我们要多点耐心。不过今天分享的方法，无论是不是肌肉型腿，多锻炼总是有助于瘦腿的。要漂亮就千万不能懒，每天花个15——30分钟，记住天底下没有丑女人，只有懒女人！<br/><br/>改变肌肉型的瘦腿方法<br/><br/>一、拍打大腿的内外侧<br/><br/>1、坐于地上，用拳头轻轻拍打双腿外侧。<br/><br/>2、双腿张开，用拳头轻拍双腿内测。<br/><br/>二、弓步压腿<br/><br/>1、双手平放地下，与肩大致平行，前后腿跨大步。<br/><br/>2、将臀部向下压，成弓箭型，维持5秒后升起臀部再来一次。前后腿部交换再做，每边做10次。可先完成一边才做另一边。注意后腿膝头要尽量伸直。<br/><br/><br/>三、仰卧拉伸<br/><br/>1、屈膝坐好，小腿尽量贴近大腿及臀部，双手放身后。<br/><br/>2、慢慢躺下，直至身体贴住地下，双手平放伸身旁。动作维持15至30秒。每日做一次。<br/><br/><br/>四、交叠前压腿<br/><br/>1、双腿交叉重叠坐在地上，双手放前面<br/><br/>2、慢慢将身体向前压，颈部同头部都要向下望，维持15至30秒。左右腿交换重叠再做一次。<br/><br/>春风十里，不如走你，运动ing...<br/><br/>文／爱蹦跶（简书作者）<br/>原文链接：http://www.jianshu.com/p/dd2ce3ebf385<br/>著作权归作者所有，转载请联系作者获得授权，并标注“简书作者”。<br/></p>', '1465181523969.jpg#1465181168993.jpg#1464317349783.jpg', '2016-07-07 12:18:32', '1');
