INSERT INTO `experience` VALUES ('26', '10', '猛练腹肌就会有六块腹肌和平坦小腹吗？', '很多朋友想拥有平坦小腹，甚至六块腹肌，每天都拼命的做仰卧起坐。但我要告诉你，仰卧起坐并不是拥有平坦小腹和六块腹肌最有效的方法。', '1465181523969.jpg#1465181168993.jpg#1464317349783.jpg', '2016-07-07 12:18:32', '1');
