INSERT INTO `experience` VALUES ('30', '8', '小腹燃脂操 坚持30天你就能穿比基尼玩小鲜肉啦', '<div style=\"text-align: left;\"><span style=\"color: inherit;\">小腹燃脂大挑战，坚持30天你就能穿比基尼玩小鲜肉啦</span></div><div style=\"text-align: left;\"><span style=\"color: inherit;\">天气越来越热咯，然而我知道你的身材还没准备好穿比基尼~ 想想海滩上穿得比你还少的小鲜肉，你是不是要努力一下才能去钓他们呢？试试这个美国COSMOPOLITAN推荐的“30天小腹毁灭计划”吧：</span></div><p>海滩上穿得比你还少的小鲜肉</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-29fa207899a9dfba.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 521px;width: 1074px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>这样的小鲜肉好想吃啊（ˉ﹃ˉ）</p><p><b>初级版小腹训练</b></p><p>如果你没有日常运动习惯，就要从初级动作开始，让身体快速适应运动的节奏，避免运动伤害。做这些动作前一定要暖身，同时准备瑜伽垫、舒适的运动服装，以及水~</p><p>跪在地上，双手打开与肩同宽，再将两只手打开、紧贴。双脚脚尖碰地，先将左脚往下压，膝盖不用碰到地上，再换另一只脚。重复做一分钟。</p><p>step1</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-9df9293b68deaca4.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 660px;width: 1083px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>简易版的仰卧起坐，上半身不用整个坐起，离地约30度即可，这样可以燃烧小腹脂肪。同样做满一分钟。</p><p>step2</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-9b21059260b2ca91.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 673px;width: 1080px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>躺在地上，双脚曲起，左右手分别去碰左右脚踝，然后用手再碰头部。上半身微微抬起，跟上一个动作一样，离地约30度，做一分钟。</p><p>step3</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-25cea6f2af3e2a90.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 632px;width: 1076px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>双手自然平放在身体两侧，双脚微弯，上半身不完全躺下，头部离开地面约30度。将微弯的双脚抬起，放下时不要放回地面，一直维持在半空中，一样重复做一分钟。</p><p>step4</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-c927551f619998c5.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 720px;width: 1095px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>站起来，将双手平放至腰间前，原地跑起，确认膝盖碰至手掌，重复一分钟。</p><p>step5</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-348bcb53e1c12157.gif?imageView2/2/w/1240\" class=\"imagebubble-image\" style=\"height: 671px;width: 1081px;\"/><br/><div class=\"image-caption\"></div><br/></div><p><b>进阶版小腹训练</b></p><p>初级版训练连续做一周之后，你就可以开始进阶版了。</p><p>先趴在地上，双手打开与肩同宽，两只手掌紧贴，先将左脚往上抬至屁屁上方，接着再换另一只脚，重复一分钟。</p><p>step6</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-4a0ab55096b2af45.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 687px;width: 1094px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>躺在地上，双脚打直并拢并抬起，让身体呈90度，双手放至头后方，先用左手去碰左脚踝，再伸回来放回头部后方，接着换右手，重复做一分钟。</p><p>step7</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-1014146001a7feef.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 767px;width: 1085px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>双脚微弯，上半身抬起，只剩屁屁在地上。双脚保持不动，左手放在右手上，上半身分别向左右两边旋转，重复做一分钟。</p><p>step8</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-48c7b86c2b7518f0.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 670px;width: 1100px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>躺下来，双手自然放在身体旁，上半身微微抬起，离地约30度。双脚抬至空中，上下交互移动，重复一分钟。</p><p>step9</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-0c53c52157423989.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 735px;width: 1102px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>双手撑在地上，脚尖碰地，再将左脚往上抬，小腿呈现平行状态，接着换右脚，一样重复一分钟。</p><p>step10</p><div class=\"image-package imagebubble\"><br/><img src=\"http://upload-images.jianshu.io/upload_images/2220923-e2143649b83e78b1.gif?imageMogr2/auto-orient/strip\" class=\"imagebubble-image\" style=\"height: 627px;width: 1096px;\"/><br/><div class=\"image-caption\"></div><br/></div><p>做完运动之后，切记不要急着躺下来休息，要做一些缓和动作，像是原地踏步、拉筋等等，第二天才不会全身酸痛哦。现在开始还来得及，Girls快快动起来吧~</p><p><br/></p><p><br/></p><div>文／瘦身宝典（简书作者）<br/>原文链接：http://www.jianshu.com/p/8588fb0da0a9<br/>著作权归作者所有，转载请联系作者获得授权，并标注“简书作者”。</div><!--EndFragment--><p><br/></p><p><br/></p>', '1465196441309.jpg', '2016-07-07 12:18:32', '1');
