INSERT INTO `experience` VALUES ('49', '13', '维持腹肌最佳状态的徒手健身计划', '<p><span>很多人练出了腹肌，但是确不知腹肌也需要经常做“保养”的。为了为此我们的腹肌和人鱼线，下面这个计划就适合你每天做。只花费你25分钟的锻炼，每天5个简单动作，每个动作进行2-5分钟。保证不是你“没有时间，忙” 的借口</span></p><p style=\"text-align: center;\"> </p><p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.jirou.com/uploads/allimg/160608/1015125150-0.jpg?1464680184\"/></p><p style=\"text-align: center;\">在开始前，也请先遵守以下约定</p><p>　　不能老是想着：</p><p>　　<strong>1.<span class=\"Apple-converted-space\"> </span></strong><strong>太多事情要做，时间太少</strong></p><p>　　<strong>2. 日常琐事太累了</strong></p><p>　　<strong>3. 太难遵循常规</strong></p><p>　　<strong>4. 坚持节食好麻烦</strong></p><p>　　<strong>5. 懒</strong></p><p><span><span>动作1：Brisk walk (健走步伐)</span></span></p><p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.jirou.com/uploads/allimg/160608/1015126310-2.jpg?1464678853\"/></p><p>　　或许你能从下课、下班就开始这个25分钟计划，而且你不能否认这对于运动初学者来说是最容易去执行的选择，你可以尝试把以往通勤路线改以健走的方式行走，尽管只是捷运站走回家，透过这样的步伐进行，轻快地行走，若更有心，那么你可以把原本预设的5分钟拉长至20分钟不等</p><p style=\"text-align: center;\"><img alt=\"\" src=\"https://j.gifs.com/820BJj.gif\"/></p><p>　　根据美国疾病控制与防御中心指出(CDC)：<strong>以每小时5公里或每公里12分钟的速度快走，对于健康效果是最好帮助的！</strong></p><p><span><span>　　动作2：Bicycle Crunch (空骑脚踏车)</span></span></p><p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.jirou.com/uploads/allimg/160608/10151243V-4.jpg?1464678851\"/></p><p>　　这动作比起最原始的Crunch动作来说偏属于轻松的等级了，不过透过这动作也能间接的训练到你的腹肌，然而小编也会建议你可以在底下垫上一张瑜伽垫或其他质地偏软的毯子等等！</p><p style=\"text-align: center;\"><img alt=\"\" src=\"https://j.gifs.com/PNA5B1.gif\"/></p><p>　　从平躺在地上的背部开始，双手放至耳后，另外要注意位置不要后扣在后面，再抬起你的双腿在空中将膝盖弯曲，让你的腿以90度呈现，之后即可以开始以踩自行车的方式运动你的腿，另外变化行则是当你的左膝贴近你身体时，右肘就向内移动，反之亦然，这个动作每次1-2分钟，共进行2组即可。</p><p><span><span>　　动作3：Boat pose exercise (静止式船型运动)</span></span></p><p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.jirou.com/uploads/allimg/160608/1015121134-6.jpg?1464678848\"/></p><p>　　在进行这个动作的时候，同样的也请使用一个垫子于下方为避免伤害你的脊椎！</p><p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.jirou.com/uploads/allimg/160608/1015126200-8.gif\"/></p><p>　　这个动作也很简单，膝盖弯曲后，以双脚放在地上的坐姿状态开始，通过你的躯干延长，而将上半部身体略放倒，像似保持一条直线于你背部的感觉，扩展你的手臂到你面前并伸直、延伸，再来则是扩展你的腿，整个人的躯干与腿会呈现一个90度(v型)，这个动作一开始进行30秒，随着后面地组数进行渐渐延长执行时间，共进行3-4组即可，不过运作的过程中也别忘了要轻轻呼吸。</p><p><span><span>　　动作4：Plank（平板支撑）</span></span></p><p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.jirou.com/uploads/allimg/160608/1015125Z6-10.jpg?1464678849\"/></p><p style=\"text-align: center;\">有做过这动作的人应该都知道这姿势看似简单，但做起来却折磨惨…</p><p>　　正面朝下，放在你的肩膀下方的位置，手肘弯曲到90度，将上身的力量与重量停留在你的前臂处，然而肘部应该直接保持在你的肩膀下面，这样你的身体应该和你的头部与脚呈现一直线，这样的姿势每次保持15秒，逐渐维持趋向2分钟的长度！</p><p><span><span>　　动作5：Bridge exercise(桥式运动)</span></span></p><p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.jirou.com/uploads/allimg/160608/101512B59-12.jpg?1464678854\"/></p><p>　　这个动作若做的确实，不但能够提升你的柔软度，也能当作训练自己进行瑜伽运动的基本功！</p><p style=\"text-align: center;\"><img alt=\"\" src=\"https://j.gifs.com/lYNMnM.gif\"/></p><p>　　躺在地上后，将身体后躬弯曲，并将双手背部放置地上，然后确保膝盖弯曲，双脚脚底放在地板平整并保持牢固，然后开始收紧你的腹部与臀部区域的肌肉，同时抬起你的臀部，从而创造一个从膝盖到肩膀的直线样貌，尽可能地挤压你的核心，并尝试你的肚脐走回至你的脊椎上方处，刚开始尝试10秒，然后逐渐增加至40秒即可！</p><!--EndFragment--><p><br/></p><p><br/></p>', '1469175108377.png', '2016-07-22 16:15:12', '1');
