-- ----------------------------
-- Table structure for `constant`
-- ----------------------------
DROP TABLE IF EXISTS `constant`;
CREATE TABLE `constant` (
  `constant_id` int(11) NOT NULL AUTO_INCREMENT,
  `first_joint_fee` double(10,2) DEFAULT '0.00' COMMENT '首次对接费用百分比',
  `order_period_of_validity` int(11) DEFAULT '1' COMMENT '订单有效期【天】未选课程的订单有效期应为可配置变量（天为单位）',
  `booking_period_of_validity` int(11) DEFAULT '0' COMMENT '选择课程时间,距离现在不可选择的时间（小时）',
  `refund_priod_of_validity` int(11) DEFAULT '6' COMMENT '离上课时间前多久可以退款-6个小时',
  `warning_booking_hour` int(11) DEFAULT '1' COMMENT '教练回应用户预约时间的系统警告',
  PRIMARY KEY (`constant_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='常量配置';

