-- ----------------------------
-- Table structure for `coupon`
-- ----------------------------
DROP TABLE IF EXISTS `coupon`;
CREATE TABLE `coupon` (
  `coupon_id` int(11) NOT NULL AUTO_INCREMENT,
  `provider` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '提供者',
  `coupon_name` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '优惠券名称',
  `coupon_money` double(10,2) DEFAULT '0.00' COMMENT '优惠券金额',
  `coupon_number` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '优惠券唯一编码一定要用8位',
  `usable_day` int(11) DEFAULT '1' COMMENT '有效天数',
  `coupon_rule` text CHARACTER SET utf8 COMMENT '优惠券规则',
  `consume_money` double(10,2) DEFAULT '0.00' COMMENT '单次消费需要超过的金额数【规则】',
  `category_01_id` int(11) DEFAULT '0' COMMENT '一级分类是否可使用：0-不限，其他-受限',
  `category_02_id` int(11) DEFAULT '0' COMMENT '二级分类是否可使用：0-不限，其他-受限',
  `is_seller` int(11) DEFAULT '0' COMMENT '0-否，其他【是否指定的商家活动（即指定商家发布的课程才可使用）ID】',
  `is_course` int(4) DEFAULT '0' COMMENT '是否指定课程：0-否，1-是【课程ID】',
  `number` varchar(255) DEFAULT '' COMMENT '优惠券数字【2-活动优惠券-供用户输入领取】',
  `num_coupon_amount` int(11) DEFAULT '0' COMMENT '优惠券数量【2-活动优惠券】',
  `limit_num` int(11) DEFAULT '0' COMMENT '每个账户的兑换次数【2-活动优惠券】',
  `coupon_type` int(4) DEFAULT '1' COMMENT '优惠券类型：1-普通优惠券，2-活动优惠券',
  `post_time` datetime DEFAULT NULL,
  `status` int(4) DEFAULT '1' COMMENT '0-隐藏，1-显示',
  PRIMARY KEY (`coupon_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='常规优惠券';

-- ----------------------------
-- Records of coupon
-- ----------------------------

-- ----------------------------
-- Table structure for `course`
-- ----------------------------
DROP TABLE IF EXISTS `course`;
CREATE TABLE `course` (
  `course_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(255) DEFAULT '' COMMENT '发布者',
  `user_images_01` varchar(255) DEFAULT NULL COMMENT '课程头像',
  `title` varchar(255) DEFAULT '' COMMENT '课程标题',
  `category_01_id` int(11) NOT NULL DEFAULT '0' COMMENT '第一大类Id',
  `category_01_name` varchar(255) DEFAULT '' COMMENT '第一类名称',
  `category_02_id` int(11) NOT NULL DEFAULT '0' COMMENT '第二大类Id',
  `category_02_name` varchar(255) DEFAULT '' COMMENT '第二类名称',
  `catetory_id` int(11) DEFAULT '0' COMMENT '0-不属于自定义分类，其他-属于自定义分类',
  `catetory_name` varchar(255) DEFAULT '' COMMENT '自定义分类名称',
  `overview` text COMMENT '简介',
  `session_length` int(8) DEFAULT '60' COMMENT '课程时长60min  以60min为单位的',
  `session_rate` double(25,2) DEFAULT '0.00' COMMENT '课程费用',
  `teaching_age` varchar(255) DEFAULT '' COMMENT '教育年限【age 5 and up】',
  `teaching_since` varchar(255) DEFAULT '' COMMENT '开始教育时间【since Jun 2007】',
  `travel_to_session` int(5) DEFAULT '0' COMMENT '是否上门服务:1-是，0-否【如果选择no,下面的distance（距离）、trafic surcharge（交通费）变灰，无法操作】',
  `travel_to_session_distance` int(10) DEFAULT '0' COMMENT '上门服务距离【miles】【可以接受多大范围内的上门服务】',
  `travel_to_session_distance_double` double(22,2) DEFAULT '0.00' COMMENT '上门服务距离【米】【可以接受多大范围内的上门服务】',
  `travel_to_session_trafic_surcharge` double(20,2) DEFAULT '0.00' COMMENT '上门服务交通费',
  `city` varchar(255) DEFAULT '' COMMENT '州【上课地址】',
  `area` varchar(255) DEFAULT '' COMMENT '城市【上课地址】',
  `street` varchar(255) DEFAULT '' COMMENT '街道【上课地址】',
  `address` varchar(255) DEFAULT '' COMMENT '详细地址【上课地址】',
  `zipcode` varchar(255) DEFAULT '' COMMENT '城市编码',
  `latitude` varchar(255) DEFAULT '' COMMENT '维度【上课地址】',
  `longitude` varchar(255) DEFAULT '' COMMENT '经度【上课地址】',
  `additional_partner` int(11) DEFAULT '0' COMMENT '额外的最多人【打折幅度】',
  `surcharge_for_each` double(20,2) DEFAULT '0.00' COMMENT '每个人的附加费用【打折幅度】',
  `discount_type` int(5) DEFAULT '1' COMMENT '打折类型：1-by_total,2-by_account',
  `discount_onetion_pur_money_01` double(20,2) DEFAULT '0.00' COMMENT 'A:选择 By account的意思：一次性购买多少课程，打折多少B:选择 By total的意思：一次性购买多少钱，打折多少',
  `discount_price_01` double(20,2) DEFAULT '0.00' COMMENT '打折价格',
  `discount_onetion_pur_money_02` double(20,2) DEFAULT '0.00' COMMENT '如果选中by total:One-time Purchase $XX,discount price $XX如果选中by account:One-time Purchase XX,discount price $XX',
  `discount_price_02` double(20,2) DEFAULT '0.00' COMMENT '打折价格',
  `discount_onetion_pur_money_03` double(20,2) DEFAULT '0.00',
  `discount_price_03` double(20,2) DEFAULT '0.00' COMMENT '打折价格',
  `banners` varchar(255) DEFAULT '' COMMENT 'banners【拼接如：11.jpg#22.jpg#11.jpg#22.jpg【图片名称#图片名称】】',
  `videos` varchar(255) DEFAULT '' COMMENT '视频s【拼接如：http://#http://#http://#http://【url名称#url名称】】',
  `is_hot_recommand` int(5) DEFAULT '0' COMMENT '是否热门推荐：0-否，1-是',
  `hot` int(11) DEFAULT '0' COMMENT '热度【每浏览一次加1】',
  `status` int(5) DEFAULT '1' COMMENT '-1-待提交，0-隐藏，1-显示，2-待审核',
  `sort` int(11) DEFAULT '0' COMMENT '从小优先排序',
  `total_score` double(10,2) DEFAULT '0.00' COMMENT '评论总分【每次评价更新，最高分5分】',
  `post_time` datetime DEFAULT NULL,
  `hours` text COMMENT '时间段：【1@1',
  `achievements` text COMMENT '成果',
  `specialist` text COMMENT '擅长领域',
  `is_frozen` int(4) DEFAULT '1' COMMENT '是否教练被冻结：1-否，2-冻结',
  PRIMARY KEY (`course_id`),
  KEY `sort` (`sort`),
  KEY `title` (`title`(191)),
  KEY `category_01_name` (`category_01_name`(191)),
  KEY `category_02_name` (`category_02_name`(191)),
  KEY `catetory_name` (`catetory_name`(191))
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8mb4 COMMENT='课程';

