-- ----------------------------
-- Table structure for `feedback`
-- ----------------------------
DROP TABLE IF EXISTS `feedback`;
CREATE TABLE `feedback` (
  `feedback_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `content` text COMMENT '内容',
  `name` varchar(255) DEFAULT NULL COMMENT '姓名',
  `email` varchar(255) DEFAULT NULL COMMENT '联系方式-emial',
  `post_time` datetime DEFAULT NULL,
  `phone` varchar(255) DEFAULT '' COMMENT 'email',
  PRIMARY KEY (`feedback_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of feedback
-- ----------------------------

-- ----------------------------
-- Table structure for `index_banner`
-- ----------------------------
DROP TABLE IF EXISTS `index_banner`;
CREATE TABLE `index_banner` (
  `index_banner_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'banner',
  `cover` varchar(255) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '封面',
  `big_cover` varchar(255) CHARACTER SET utf8mb4 DEFAULT '' COMMENT 'pc端的banner',
  `type` int(11) DEFAULT '1' COMMENT '类型：1-引导页，2-首页banner,3-闪屏页',
  `content` text CHARACTER SET utf8mb4 COMMENT '内容',
  `post_time` datetime DEFAULT NULL COMMENT '上传时间',
  `status` int(4) DEFAULT '1' COMMENT '0-下线-1-上线',
  PRIMARY KEY (`index_banner_id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='说明：banner表 操作： 备注： 作者：kingsley 日期：2015-09-12';

-- ----------------------------
-- Records of index_banner
