-- ----------------------------
-- Table structure for `my_coupon`
-- ----------------------------
DROP TABLE IF EXISTS `my_coupon`;
CREATE TABLE `my_coupon` (
  `my_coupon_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT '0' COMMENT '领取者',
  `provider` varchar(255) DEFAULT '' COMMENT '提供者',
  `coupon_name` varchar(255) DEFAULT '' COMMENT '优惠券名称',
  `coupon_money` double(10,2) DEFAULT '0.00' COMMENT '优惠券单价',
  `coupon_num` int(11) DEFAULT '1' COMMENT '优惠券数量',
  `coupon_number` varchar(255) DEFAULT '' COMMENT '优惠券唯一编码一定要用8位',
  `begin_time` datetime DEFAULT NULL COMMENT '有效期 开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `coupon_rule` text COMMENT '优惠券规则',
  `post_time` datetime DEFAULT NULL,
  `consume_money` double(10,2) DEFAULT '0.00' COMMENT '单次消费需要超过的金额数【规则】',
  `category_01_id` int(11) DEFAULT '0' COMMENT '一级分类是否可使用：0-不限，其他-受限',
  `category_02_id` int(11) DEFAULT '0' COMMENT '二级分类是否可使用：0-不限，其他-受限',
  `is_seller` int(4) DEFAULT '0' COMMENT '0-否，1-是【是否指定的商家活动（即指定商家发布的课程才可使用）】',
  `is_course` int(11) DEFAULT '0' COMMENT '是否指定课程：0-否，1-是【课程ID】',
  `status` int(4) DEFAULT '1' COMMENT '-1-过期，0-删除，1-正常，2-已使用',
  PRIMARY KEY (`my_coupon_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COMMENT='我的优惠券';

-- ----------------------------
-- Records of my_coupon
-- ----------------------------

-- ----------------------------
-- Table structure for `orders`
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `orders_id` int(11) NOT NULL AUTO_INCREMENT,
  `status` int(5) DEFAULT '1' COMMENT '1-加入购物车,2-购物车失效产品，9-删除订单【未付款】，10-一般订单失效，11-待付款，12,-已完成删除订单【用户】，20-已完成删除订单【教练】，21-用户可退款【已付款】,22-用户不可退款【已付款】，30-已完成，40-已评价',
  `booking_status` int(5) DEFAULT '1' COMMENT '是否出现booking按钮：1-可booking，2-不可booking',
  `has_refund_status` int(5) DEFAULT '1' COMMENT '是否有退款：1-没有，2-有',
  `user_id` int(11) DEFAULT '0' COMMENT '购买者',
  `buy_nickname` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户昵称',
  `buy_email` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '购买者email',
  `course_id` int(11) DEFAULT '0' COMMENT '课程id',
  `course_title` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '课程title',
  `course_user_id` int(11) DEFAULT '0' COMMENT '教练id',
  `course_nickname` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '教练昵称',
  `course_telephone` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '教练电话',
  `course_email` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '教练email',
  `first_joint_fee` double(10,2) DEFAULT '0.00' COMMENT '首次对接费用百分比【如果不是首次时，此处为0】【费用3】',
  `order_number` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '订单编号一定要用8位',
  `buy_amount` int(8) DEFAULT '0' COMMENT '购买数量',
  `session_rate` double(24,2) DEFAULT '0.00' COMMENT '课程单价【费用1】',
  `go_door_status` int(6) DEFAULT '0' COMMENT '是否上门服务：0-关闭，1-上门【如果选择上门服务，增加交通费，Teaching Location可选择】',
  `go_door_city` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '州【travel to session选择no后，不显示地址，表示只提供上门服务，这个时候，用户课程下单的时候必须填写地址才能下单】',
  `go_door_area` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '城市',
  `go_door_street` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '街道',
  `go_door_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '详细地址',
  `go_door_latitude` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '维度',
  `go_door_longitude` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '经度',
  `go_door_zipcode` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '城市编码',
  `go_door_traffic_cost` double(10,2) DEFAULT '0.00' COMMENT '如果选择上门服务，增加交通费课程单价【费用2】',
  `my_coupon_id` int(11) DEFAULT '0' COMMENT '0-表示没有，优惠券Id,',
  `my_coupon_money` double(10,2) DEFAULT '0.00' COMMENT '优惠券金额【优惠2】',
  `leave_message` text COLLATE utf8_unicode_ci COMMENT '给商家留言',
  `post_time` datetime DEFAULT NULL,
  `discount_type` int(4) DEFAULT '1' COMMENT '打折类型：1-by_total,2-by_account【优惠1】',
  `discount_price` double(20,2) DEFAULT '0.00' COMMENT '打折价格，0-表示无',
  `take_partner_num` int(5) DEFAULT '0' COMMENT '带的人数【费用4】',
  `surcharge_for_each_cash` double(20,2) DEFAULT '0.00' COMMENT '每个人的附加费用',
  `total_session_rate` double(20,2) DEFAULT '0.00' COMMENT '实际支付课程总价格',
  `original_total_session_rate` double(20,2) DEFAULT '0.00' COMMENT '原课程总价格',
  `refund_success_money` double(10,2) DEFAULT '0.00' COMMENT '成功退款金额',
  `transaction_id` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '交易号。',
  PRIMARY KEY (`orders_id`),
  KEY `order_number` (`order_number`),
  KEY `course_title` (`course_title`)
) ENGINE=InnoDB AUTO_INCREMENT=147 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT COMMENT='订单表';

