-- ----------------------------
-- Table structure for `orders_schedule`
-- ----------------------------
DROP TABLE IF EXISTS `orders_schedule`;
CREATE TABLE `orders_schedule` (
  `orders_schedule_id` int(11) NOT NULL AUTO_INCREMENT,
  `orders_id` varchar(255) DEFAULT '' COMMENT '订单Id',
  `user_id` varchar(255) DEFAULT '' COMMENT '购买者',
  `schedule_ids` varchar(255) DEFAULT '0' COMMENT '时间安排id：0-未选择课程，1-已选择时间[11',
  `schedule_data` varchar(255) DEFAULT '' COMMENT '课程日期',
  `schedule_hours` varchar(255) DEFAULT NULL COMMENT '课程时间段',
  `schedule_time_slots` varchar(15) DEFAULT '0' COMMENT '0-表示全天，1-2-3 ....分别对应时间格子,A连接多个',
  `status` int(5) DEFAULT '4' COMMENT '1-完成课程(finished)，20-教练确认时间(confirmed),21-教练拒绝用户时间(未选择时间),22-教练取消订单(cancel),3-教练未确认时间(unconfirmed),4-用户未选择时间(unchoice)',
  `refund_status` int(5) DEFAULT '10' COMMENT '退款状态：1-预定完时间教练48小时内没有回复后才可以申请退款，10-用户未申请退款，2-退款中[pending]，30-教练申请取消订单退款中[completed],31-管理员确认退款完成[completed]，4-不能退款[unrefund]也不能选择时间，课程已完成也不能',
  `refund_reason` varchar(255) DEFAULT '' COMMENT '教练refuse用户时间的原因',
  `post_time` datetime DEFAULT NULL COMMENT '提交时间',
  `order_period_of_validity` int(11) DEFAULT '1' COMMENT '订单有效期【天】未选课程的订单有效期应为可配置变量（天为单位）',
  `order_period_start_time` datetime DEFAULT NULL COMMENT '有效起始时间',
  `refund_priod_of_validity` int(11) DEFAULT '1' COMMENT '离上课时间前多久可以退款-6个小时',
  `refund_priod_start_time` datetime DEFAULT NULL COMMENT '退款开始时间',
  `finish_status` int(5) DEFAULT '1' COMMENT '是否出现finish按钮：1-不可finish_status，2-可finish_status',
  `is_pay` int(5) DEFAULT '0' COMMENT '是否付款：1-已支付，0-未付款',
  PRIMARY KEY (`orders_schedule_id`)
) ENGINE=InnoDB AUTO_INCREMENT=325 DEFAULT CHARSET=utf8mb4 COMMENT='上课时间【显示的是可以所有退款课程，包括成功退款，退款中，可以申请退款的课程，不包括已经交易完成的课程（已经上课）】';

-- ----------------------------
-- Records of orders_schedule
-- ----------------------------

-- ----------------------------
-- Table structure for `rule`
