DROP TABLE IF EXISTS `rule`;
CREATE TABLE `rule` (
  `rule_id` int(11) NOT NULL AUTO_INCREMENT,
  `consume_money` double(10,2) DEFAULT '0.00' COMMENT '用户单次消费金额',
  `consume_total_money` double(10,2) DEFAULT '0.00' COMMENT '用户总消费金额',
  `buy_num` int(10) DEFAULT '0' COMMENT '用户购买课时次数',
  `new_regist` int(4) DEFAULT '0' COMMENT '新用户注册：0-否，1：是',
  `post_time` datetime DEFAULT NULL,
  PRIMARY KEY (`rule_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='推送总规则';

