-- Records of rule
-- ----------------------------

-- ----------------------------
-- Table structure for `schedule`
-- ----------------------------
DROP TABLE IF EXISTS `schedule`;
CREATE TABLE `schedule` (
  `schedule_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(255) DEFAULT '',
  `choice_currentdate` date DEFAULT '0000-00-00' COMMENT '选择日期【2016-06-04】',
  `time_slot` int(11) DEFAULT '0' COMMENT '0-表示全天，1-2-3 ....分别对应时间格子',
  `remarks` text COMMENT '备注',
  `username` varchar(255) DEFAULT '' COMMENT '用户名称',
  `orders_id` int(11) DEFAULT '0' COMMENT '订单ID',
  `course_id` int(11) DEFAULT '0' COMMENT '课程ID',
  `course_name` varchar(255) DEFAULT '' COMMENT '课程名称',
  `course_time` varchar(255) DEFAULT '' COMMENT '课程时间',
  `course_location` varchar(255) DEFAULT '' COMMENT '课程地址',
  `type` int(5) DEFAULT '1' COMMENT '0-被预约，1-unavaliable，2-busy,3-空闲时间添加备注',
  `status` int(5) DEFAULT '1' COMMENT '0-隐藏，1-显示',
  PRIMARY KEY (`schedule_id`)
) ENGINE=InnoDB AUTO_INCREMENT=476 DEFAULT CHARSET=utf8 COMMENT='日程安排【默认全天有空闲】';

