-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '邮件登陆',
  `password` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '密码',
  `nickname` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '昵称',
  `image_01` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户头像',
  `sex` int(5) DEFAULT '2' COMMENT '性别：0-女，1-男，2-保密',
  `money` double(20,2) DEFAULT '0.00' COMMENT '钱',
  `frozen_money` double(20,2) DEFAULT '0.00' COMMENT '冻结金额【待体现冻结】',
  `apply_money` double(20,2) DEFAULT '0.00' COMMENT '已提现金额',
  `province` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '省',
  `city` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '市',
  `area` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '区',
  `birthday` varchar(255) COLLATE utf8_unicode_ci DEFAULT '',
  `age` int(11) DEFAULT '0' COMMENT '年龄',
  `telephone` varchar(200) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '电话号码',
  `cover_ID_01` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '身份证正面',
  `cover_ID_02` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '身份证反面',
  `is_official` int(8) DEFAULT '0' COMMENT '是否官方认证：0-否，1-是',
  `coupon_change_max_num` int(8) DEFAULT '0' COMMENT '最多领取优惠券次数',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `post_time` datetime DEFAULT NULL COMMENT '日期',
  `last_read_time` datetime DEFAULT '2015-11-11 11:10:10' COMMENT '最后一次访问系统消息的时间',
  `status` int(5) DEFAULT '1' COMMENT '0-封号，1-正常，2-未激活',
  `agent_level` int(5) DEFAULT '1' COMMENT '1-普通用户，2-教练',
  `authen_status` int(5) DEFAULT '0' COMMENT '教练审核：0-未认证，1-审核中，2-审核通过，3-审核不通过',
  `authen_num` int(6) DEFAULT '3' COMMENT '最多申请认证三次',
  `authen_time` datetime DEFAULT NULL COMMENT '认证日期',
  `is_stop_course` int(8) DEFAULT '0' COMMENT '今后暂停课程 0-否，1-是',
  `stop_course_time` datetime DEFAULT NULL COMMENT '最后停课时间',
  `category_name` varchar(200) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '分类名称',
  `experiences` varchar(80) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '经验是1年 -15年',
  `setting_notify_start_course` int(5) DEFAULT '0' COMMENT '1-开启开课前通知，0-关闭',
  `is_third` int(8) DEFAULT '0' COMMENT '是否第三方：0-正常注册{可修改密码}，1-第三方注册{不可修改密码}，2-已绑定{可修改密码}',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=108 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT COMMENT='用户表';

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for `zip_code`
-- ----------------------------
DROP TABLE IF EXISTS `zip_code`;
CREATE TABLE `zip_code` (
  `zip_code_id` int(11) NOT NULL AUTO_INCREMENT,
  `zipcode` varchar(20) DEFAULT NULL COMMENT '邮编',
  `city` varchar(150) DEFAULT NULL COMMENT '城市(city)',
  `county` varchar(150) DEFAULT NULL COMMENT 'state　州（state)',
  `state` varchar(10) DEFAULT NULL COMMENT 'state',
  PRIMARY KEY (`zip_code_id`)
) ENGINE=InnoDB AUTO_INCREMENT=41857 DEFAULT CHARSET=utf8mb4 COMMENT='美国zip_code';

-- ----------------------------
-- Records of zip_code
-- ----------------------------
